-- PROCEDURE c_apc_process_error_sc_intf (errbuff   OUT VARCHAR2,
  --                                        retcode   OUT NUMBER)
  -- IS
declare  

   /************
   * Constants
   ************/
   vgc_process CONSTANT         VARCHAR2 (100) := 'Rev Pro SC Interface Process';
   vgc_package CONSTANT         VARCHAR2 (100) := 'c_apc_inv_error_sc_intf_pkg';
   vgc_yes CONSTANT             VARCHAR2 (1) := 'Y';
   vgc_username                 VARCHAR2 (100):='ODI_REVPRO' ;
   vgc_user_id                  NUMBER :=-1 ;
   vgc_no CONSTANT              VARCHAR2 (1) := 'N';
   vgc_request_id               NUMBER ;

   TYPE vgc_type_run_hist_q_upd
   IS
      TABLE OF c_fnd_intf_run_history_queue@erprevrec%ROWTYPE
         INDEX BY BINARY_INTEGER;

      /**************
      * Constants
      **************/
      vc_local_function    VARCHAR2 (80) := 'c_apc_process_error_sc_intf()';
      /**************
      * Variables
      **************/
      vl_action            VARCHAR2 (4000);
      vl_error_code_text   VARCHAR2 (200) := NULL;
      vl_error_msg         VARCHAR2 (2000) := NULL;
      vl_update_flag       VARCHAR2 (1);
      vl_count             NUMBER (10) := 0;
      vl_run_hist_q_rec    c_fnd_intf_run_history_queue@erprevrec%ROWTYPE;
      vl_debug_level       NUMBER (2) := 15;
      vl_errbuff           VARCHAR2 (2000) := NULL;
      vl_retcode           NUMBER;
      vl_batch_id          NUMBER (10);
      vl_run_hist_q_upd    vgc_type_run_hist_q_upd;
      v_cnt                NUMBER (10) := 0;
      vl_errbuff_purg      VARCHAR2 (2000) := NULL;
      vl_retcode_purg      NUMBER;

      /**************
      * Cursors
      **************/
      CURSOR cur_rev_err_staging
      IS
         SELECT  
                  rls.inv_line_id,
                  rls.type,
                  rls.ERR_MSG
           FROM   apc.c_apc_rev_conv rls
          WHERE       atr2 = 'EBSSC'
                  AND rls.PROCESSED_FLAG = 'E'
                  AND rls.ATR60  IS NULL
                  and rls.type in('INV','CM');

   BEGIN

      BEGIN

         SELECT   hq.*
           BULK   COLLECT
           INTO   vl_run_hist_q_upd
           FROM   c_fnd_intf_run_history_queue@erprevrec hq,
                  c_fnd_intf_run_history@erprevrec his
          WHERE   his.batch_id = hq.batch_id
                  AND his.interface_name =vgc_package || '.' || vc_local_function
                  AND hq.status='FAILED';

         /* Updating Queue Table Data to Processed */

         FOR i IN vl_run_hist_q_upd.FIRST .. vl_run_hist_q_upd.LAST
         LOOP
            BEGIN
               vl_run_hist_q_upd (i).status := 'PROCESSED';

               vl_run_hist_q_upd (i).error_message :='NO ERROR';


               c_fnd_run_history_pkg.update_intf_run_hist_queue@erprevrec (
                  vl_run_hist_q_upd (i)
               );

              COMMIT;

            EXCEPTION
               WHEN OTHERS
               THEN
                 NULL;

            END;
         END LOOP;
      EXCEPTION
         WHEN OTHERS
         THEN
             NULL;
      END;


    /*  BEGIN



     c_fnd_run_history_pkg.purge_run_history_data@erprevrec(vl_errbuff_purg,vl_retcode_purg,vl_debug_level,vgc_package || '.' || vc_local_function,NULL,1);

     commit;

     wrtlog ('Previous Error Data Purge Completed');



       EXCEPTION
         WHEN OTHERS
         THEN
            wrtlog ('ERROR while purging data' || SQLERRM);

      END; */


      BEGIN
         SELECT   COUNT ( * )
           INTO   vl_count
           FROM   apc.c_apc_rev_conv rls
          WHERE       atr2 = 'EBSSC'
                AND rls.PROCESSED_FLAG = 'E'
                  AND rls.ATR60  IS NULL
                  and rls.type in('INV','CM');

         IF vl_count > 0
         THEN

         --vgc_request_id := :GLOBAL.ODI_INV_SEQ_ODI_ID_NEXTVAL;

         vgc_request_id :=ODI_INV_SEQ_ODI_ID.NEXTVAL;

            c_fnd_run_history_pkg.create_run_history_data@erprevrec (
               po_errbuf           => vl_errbuff,
               po_retcode          => vl_retcode,
               pi_debug_level      => vl_debug_level,
               pi_interface_name   => vgc_package || '.' || vc_local_function,
               pi_attribute1       => vgc_request_id,
               pi_attribute2       => NULL,
               pi_attribute3       => NULL,
               pi_attribute4       => NULL,
               pi_attribute5       => NULL,
               pi_batch_run_date   => sysdate
            );


            -- commit;


         END IF;
      --    DBMS_OUTPUT.put_line ('Record has been inserted in c_fnd_intf_run_history table' || SQLERRM);


      EXCEPTION
         WHEN OTHERS
         THEN
 NULL;
      END;


      BEGIN
         vl_action := 'Fetching batch id from create_run_history_data ';


         SELECT   TO_NUMBER (batch_id)
           INTO   vl_batch_id
           FROM   c_fnd_intf_run_history@erprevrec
          WHERE   attribute1 = TO_CHAR (vgc_request_id);
      --commit;


      EXCEPTION
         WHEN OTHERS
         THEN

 NULL;
      END;



      FOR rev_staging_err_rec IN cur_rev_err_staging
      LOOP
         EXIT WHEN cur_rev_err_staging%NOTFOUND;
       --  vl_action :=
         --   'Working on Staging Record ID:  ' || rev_staging_err_rec.ID;

         BEGIN
            vl_run_hist_q_rec.QUEUE_ID :=
               c_fnd_intf_run_history_queue_s.NEXTVAL@erprevrec;
            vl_run_hist_q_rec.BATCH_ID := vl_batch_id;
            vl_run_hist_q_rec.STATUS := 'FAILED';
            vl_run_hist_q_rec.ERROR_MESSAGE := rev_staging_err_rec.ERR_MSG;--'MARKED AS ERROR BY REV PRO';
          --  vl_run_hist_q_rec.REFERENCE_NUMBER := rev_staging_err_rec.ID;
            --vl_run_hist_q_rec.ATTRIBUTE1 := rev_staging_err_rec.so_num;
            --vl_run_hist_q_rec.ATTRIBUTE2 := rev_staging_err_rec.so_line_id;
            --vl_run_hist_q_rec.ATTRIBUTE3 := rev_staging_err_rec.inv_num;
            vl_run_hist_q_rec.ATTRIBUTE4 := rev_staging_err_rec.inv_line_id;
            vl_run_hist_q_rec.ATTRIBUTE5 := rev_staging_err_rec.TYPE;
            vl_run_hist_q_rec.creation_date := SYSDATE;
            vl_run_hist_q_rec.last_update_date := SYSDATE;
            vl_run_hist_q_rec.created_by := vgc_user_id;
            vl_run_hist_q_rec.last_updated_by := vgc_user_id;



            c_fnd_run_history_pkg.insert_intf_run_hist_queue@erprevrec (
               vl_run_hist_q_rec
            );


         EXCEPTION
            WHEN OTHERS
            THEN
               ROLLBACK;
               DBMS_OUTPUT.put_line ('ERROR: ' || SQLERRM);
         END;
      END LOOP;



      BEGIN




        update   apc.c_apc_rev_conv rls
           set   rls.atr60 = 'Y'
         where       atr2 = 'EBSSC'
                  AND rls.PROCESSED_FLAG = 'E'
                  AND rls.ATR60  IS NULL
                  and rls.type in('INV','CM');

                 COMMIT;


      EXCEPTION
            WHEN OTHERS
            THEN
               ROLLBACK;
      END;




   EXCEPTION
      WHEN OTHERS
      THEN
         ROLLBACK;
   END;
